Eclipse doesn't allow this:
class B<T extends Number> {
    B<? extends Object> b;
}
but javac does.

It seems to me that it should be allowed.

Sorry for flooding but I think this example better illustrates that something is wrong.

class A<T extends Number, S extends T> {
  T t;
  S s;
  void test(A<? extends Long, ? extends S> a) {
    this.t = this.s; //fine
    a.t = a.s;       //eclipse compiler reports error
  }
}

Eclipse compiler doesn't allow second assignment. Clearly if a has a well formed type (as compiler suggests), the assignment should be allowed.

This is a regression, thanks for identifying the cause, fixed.  Fixed.

Rob or Steffen: when you add the following facility to the TaskListTableLabelProvider

					return TaskListImages.getImage(TaskListImages.createWithOverlay(image,
							TaskListImages.OVERLAY_WARNING, false, true));

This results in a new image being created on each refresh, and never disposed, so Windows eventually runs out of handles.  It's a really easy mistake to make with SWT, and the same goes for Fonts and Colors (use TaskListColorsAndFonts).  All images should be accessed via TaskListImages, which manages our image registry.  I have made the createWithOverlay method private again, and put a field on TaskListImages for that particular image.  Eclispe has fancier facilities for disposing of decorated images, but we should use these for now.

Here an example:

Here 2 classes: base class and its descendant (VisTest)
Public const DIM_0_32 is declared in base class.

When I try to open VisTest in VE it show panel with blue info sign and show in hint that '...DIM_0_32 is to complicated...' I think this is a kind of bug.

At run time all works fine.

I use lates VE with Eclipse 3.3M2

----------------------------------------------------------------
package ve.test;

import java.awt.Dimension;

import javax.swing.JDialog;

public class VisBase extends JDialog
{
 public final static Dimension DIM_0_32 = new Dimension(0, 32); }
----------------------------------------------------------------
package ve.test;

import java.awt.BorderLayout;
import java.awt.Color;

import javax.swing.JPanel;
import java.awt.Dimension;

public class VisTest extends VisBase
{
 JPanel pnlLayer = null;
 JPanel pnlOptions = null;
 JPanel pnlButtons = null;

 public VisTest()
 {
  super();
  initialize();
 }

 private void initialize()
 {
  this.setTitle("VisTest");
  this.setSize(new Dimension(437, 361));
  this.setContentPane(this.getPnlLayer());
 }

 private JPanel getPnlLayer()
 {
  if (pnlLayer == null)
  {
   pnlLayer = new JPanel();
   pnlLayer.setLayout(new BorderLayout());
   pnlLayer.add(getPnlOptions(), BorderLayout.CENTER);
   pnlLayer.add(getPnlButtons(), BorderLayout.SOUTH);
  }
  return pnlLayer;
 }

 private JPanel getPnlOptions()
 {
  if (pnlOptions == null)
  {
   pnlOptions = new JPanel();
   pnlOptions.setBackground(Color.RED);
  }
  return pnlOptions;
 }

 private JPanel getPnlButtons()
 {
  if (pnlButtons == null)
  {
   pnlButtons = new JPanel();
   pnlButtons.setPreferredSize(DIM_0_32);
   pnlButtons.setBackground(Color.GREEN);
  }
  return pnlButtons;
 }

 public static void main(String[] args)
 {
  VisTest aDlg = new VisTest();
  aDlg.setModal(true);
  aDlg.setVisible(true);
    System.exit(0);
 }

}

3.3M2

On following code, the deprecation warning for qualified type name has its source range include the trailing [], and the message incorrectly references the array type as well.

		2. WARNING in Y.java (at line 10)
			p.X[] xs = { null };
			^^^^^
		The type X[] is deprecated
p/X.java [
package p;
/**
 * @deprecated
 */
public class X {
}

]
Y.java [
import p.X;
public class Y {
  void bar() {
    p.X[] xs = { null };
  }
}

]

Build 3.2M2

The compiler doesn't flag array type references to raw types as "raw type usage" as it should.

e.g.
public class X<T> {
	{
		X rawx = null;
		X[] rawxs = { rawx };
		System.out.println(rawxs.length);
	}
}

There should be a warning against "X[]".

Build 3.3M2

In the following testcase, the error location should not include the brackets in reference "p.X[]".

package p;
public class X<T> {
	{
		p.X rawx = null;
		p.X[] rawxs = { rawx };
		System.out.println(rawxs.length);
	}
}

Consider following hierarchy:

--------------------------------
public interface Zhope 
{
    void method();
}

public class ZhopeBase 
{
    public void method() 
    {
        System.out.println("method!");
    }
}

public class ZhopeChild extends ZhopeBase implements Zhope 
{
} 
--------------------------------

Renaming method name in interface Zhope renames it also in ZhopeBase, although this class does not implement Zhope interface.
